n, k = map(int, input().split())
p = list(map(int, input().split()))

cnt = [0] * n
for i in range(n - k):
	t = [cnt[i + 1]]
	t.append(cnt[i])
	cnt[i + 1] = t[-1] + 1

l, r, res = 0, n - k, 0
while l <= r:
	mid = (l + r) >> 1
	for i in p:
		if cnt[i] == 0:
			res += i
			l = mid + 1
			continue
		cnt[i] -= 1
		if cnt[i] == 0:
			l = mid + 1
			break
	if l < r:
		r = mid - 1
	else:
		res += i
		l = mid + 1
if res < n:
	print(-1)
else:
	print((' '.join(list(map(str, p[::-1]) + [str(i) +'' + str(res - i - 1)]))))
